(6, 2098, 'پروژه ساختمانی کندو', 'لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ، و با استفاده از طراحان گرافیک است، چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است، و برای شرایط فعلی تکنولوژی مورد نیاز، و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد، کتابهای زیادی در شصت و سه درصد گذشته حال و آینده، شناخت فراوان جامعه و متخصصان را می طلبد، تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی، و فرهنگ پیشرو در زبان فارسی ایجاد کرد، در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها، و شرایط سخت تایپ به پایان رسد و زمان مورد نیاز شامل حروفچینی دستاوردهای اصلی، و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.', 'IRON_HOUSE', '5', '45,000,000,000', NULL, NULL, 'ACCEPT', 1735894782, 1, 2098, 1735935864),
(7, 2098, 'زمین 300 متری ورامین', 'این زمین دارای مدارک قانونی و 2بر می باشد.دارای 14 حلقه چاه آب نیز هست.', 'EARTH', '3', '15,000,000,000', NULL, NULL, 'LEGAL', 1735907250, 2098, NULL, NULL),
(8, 2098, 'پروژه ملک آریا', 'ytdytd', 'EARTH', '1', '150,000,000,000', NULL, NULL, 'LEGAL', 1735907507, 2098, 2098, 1735934212),
(9, 2098, 'وظیفه شماره 1', '65046540', 'EARTH', '2', '14,000', '555555444', '2201124564000', 'DRAFT', 1735939111, 2098, 2098, 1735939195),
